import React from "react";

function Ifiske() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>iFiske</h1>
      <p>Besök vår sida på iFiske: <a href="https://www.ifiske.se/fiske-sabylundssjon.htm" target="_blank" rel="noopener noreferrer">https://www.ifiske.se/fiske-sabylundssjon.htm</a></p>
    </div>
  );
}

export default Ifiske;
